function curl(){

    const url = "https://api.spreaker.com/v2/me?oauth2_access_token=20e75b947a1909b99b242724438ed46dad9576b1";

    const options = {
      headers: {
        Authorization: "Bearer 6Q************"
      }
    };

    fetch(url, options)
      .then( res => res.json() )
      .then( data => console.log(data) );
  }

  export default curl();
